(window.webpackJsonp=window.webpackJsonp||[]).push([[1353],{1708:function(n,h,t){"use strict";t.r(h);var i=t(44),g=Object(i.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-2188-ve-hoa-phuong-nhat-toc"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-2188-ve-hoa-phuong-nhat-toc"}},[n._v("#")]),n._v(" Chương 2188: Về Hỏa Phượng nhất tộc")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("“Ta đây cũng không biết, chẳng qua... Đi vào Thần giới về sau, ta cảm giác tốc độ tu luyện của mình rõ ràng tăng tốc, hình như kinh mạch cùng huyết mạch, càng thích hợp nơi này đồng dạng...” Ngoan Nhân suy nghĩ một chút nói."),t("br"),t("br"),n._v("Lúc trước vì cho Triệu Nhã khôi phục kinh mạch, Trương Huyền chuyên môn nghiên cứu qua kinh mạch ý đồ, kết quả phát hiện, Dị Linh tộc nhân kinh mạch, sai lầm rất ít, đi vào Thần giới, mới hiểu được, bọn họ kinh mạch, cùng Thần Linh giống nhau y hệt."),t("br"),t("br"),n._v("Thần Linh kinh mạch, là chư thiên vạn giới chính xác nhất, phù hợp nhất Thiên đạo, cho nên mới có thể tu vi càng ngày càng cao, vừa ra đời liền hơn xa tại danh sư đại lục cùng Thượng Thương sinh mệnh."),t("br"),t("br"),n._v("Hơn nữa, Dị Linh tộc nhân trời sinh mạnh mẽ, tuổi thọ cũng vượt xa nhân loại bình thường."),t("br"),t("br"),n._v("Nguyên nhân chính là như vậy, mới lộ ra vô cùng cường đại, không phải Khổng sư đột nhiên xuất hiện, chỉ bằng vào danh sư đại lục nhân loại bình thường, như muốn chạy về thượng cổ chiến trường, gần như không có khả năng hoàn thành!"),t("br"),t("br"),n._v("“Đi tới nơi này, tu luyện tăng tốc... Vậy có hay không khả năng, ngươi tiền bối, trong cơ thể cũng có loại này đặc thù khí lưu, cho nên, tu vi mới có thể cùng vị này Phượng Cửu Ca đồng dạng, dần dần hạ thấp?”"),t("br"),t("br"),n._v("Trương Huyền đột nhiên nói."),t("br"),t("br"),n._v("Phượng Cửu Ca tu vi dần dần hạ thấp, là bởi vì đi vào Linh Nguyên dưới hoàng thành mặt hố sâu, nếu như trước đó bản thân suy đoán toàn bộ thành lập... Linh Nguyên thành nguyên tác cư dân, cũng bị lây nhiễm loại này dòng khí màu xám, vì vậy dẫn đến tu vi càng ngày càng thấp, vốn Ngụy Thần, cuối cùng biến thành Tiên Quân, Chân Tiên, Hư Tiên, Cổ Thánh, Đại Thánh, Thánh vực..."),t("br"),t("br"),n._v("“Cái này... Ta cũng không biết!” Ngoan Nhân lắc đầu."),t("br"),t("br"),n._v("“Nhìn tới chỉ có thể nghĩ biện pháp đi cái này cái gọi là hố sâu, mới có thể biết kết quả...”"),t("br"),t("br"),n._v("Những này giao lưu trong đầu rất nhanh hoàn thành, Trương Huyền trong thời gian ngắn trong lòng có quyết định, ngẩng đầu lên, nhìn về phía thanh niên trước mắt: “Như lời ngươi nói cái chỗ kia, có thể hay không mang ta tới nhìn một chút?”"),t("br"),t("br"),n._v("“Cái này...” Phượng Cửu Ca chần chừ."),t("br"),t("br"),n._v("Chỗ kia quá nguy hiểm, cho dù hắn hiện tại, đều cảm thấy có chút hoảng sợ."),t("br"),t("br"),n._v("“Không cần khẩn trương, nếu có nguy hiểm, chúng ta lui về tới chính là... Thân thể của ngươi tình huống, tương đối đặc thù, ta hiện tại chỉ là tạm thời áp chế lại, không cho lực lượng tán loạn, muốn triệt để giải trừ tai hoạ ngầm, chỉ có thể đi xảy ra chuyện địa phương, tìm kiếm nguyên nhân!”"),t("br"),t("br"),n._v("Trương Huyền nói."),t("br"),t("br"),n._v("Cái hố sâu này không đi không được, đối phương có chỗ lo lắng lời nói, cũng chỉ có thể đã nói như vậy."),t("br"),t("br"),n._v("Đương nhiên cũng không tính là nói dối, loại này dòng khí màu xám cụ thể là cái gì, không dò xét rõ ràng, vô cùng có khả năng lặp đi lặp lại, không bằng một lần làm ra kết quả, tất cả mọi người an tâm."),t("br"),t("br"),n._v("“Tốt, ta mang ngươi tới...”"),t("br"),t("br"),n._v("Nghe hắn nói như vậy, Phượng Cửu Ca cắn răng, gật đầu nói: “Có điều, muốn đi vào trong đó, cần một cái đồ vật, mà vật như vậy, tại trong tộc, cần trở về một chuyến!”"),t("br"),t("br"),n._v("“Ngươi nói là về gia tộc?” Trương Huyền cau mày."),t("br"),t("br"),n._v("“Cái hố sâu này, phong hào Thần Vương đều không thể tiến vào dưới đáy, hơn nữa mười phần nguy hiểm, cho nên, vì phòng ngừa ngoài ý muốn, ba đại phong hào Thần Vương, dùng sức mạnh đem thông đạo phong ấn, chỉ có trong tộc đặc thù lệnh bài mới có thể đi vào...”"),t("br"),t("br"),n._v("Phượng Cửu Ca gật đầu: “Không cầm tới cái này, coi như đi vào trước mặt, cũng sẽ bị ngăn tại bên ngoài.”"),t("br"),t("br"),n._v("Trương Huyền gật đầu."),t("br"),t("br"),n._v("Thực lực bây giờ cứ việc tiến bộ không ít, nhưng muốn lặng yên không tiếng động xông qua ba đại phong hào Thần Vương lưu lại phong cấm, vẫn như cũ không làm được."),t("br"),t("br"),n._v("Cùng hắn phiền phức, còn không bằng cùng đối phương cùng nhau về nhà tộc, vừa vặn, hắn cũng muốn giả mạo Hỏa Phượng nhất tộc tộc nhân, vọt thẳng đi qua tất nhiên sẽ nhận nghi ngờ, mà đi theo vị này Phượng Cửu Ca đằng sau, liền dễ dàng nhiều."),t("br"),t("br"),n._v("Làm ra quyết định, hai người rời khỏi quán rượu lần nữa hướng về phía trước phủ đệ đi tới."),t("br"),t("br"),n._v("“Thế nào, còn không muốn đi? Chẳng lẽ, để chúng ta lại đi tìm Phượng Triêu, Phượng Tường hai vị đại nhân?”"),t("br"),t("br"),n._v("Thấy hắn vừa bị đuổi đi, tinh thần sa sút cùng ăn mày đồng dạng, giờ phút này lại đi tới trước mặt, canh giữ ở trước cửa gác cổng, nhíu nhíu mày."),t("br"),t("br"),n._v("“Ta là không muốn đi, để Phượng Triêu, Phượng Tường hai người đến đây đi!”"),t("br"),t("br"),n._v("Trong cơ thể lực lượng khôi phục, Phượng Cửu Ca lần nữa khôi phục tự tin, cũng không cùng hộ vệ suy tính, khẽ mỉm cười."),t("br"),t("br"),n._v("“Không biết sống chết...” Hừ một tiếng, hộ vệ xoay người đi vào, thời gian không dài, tiếng bước chân vang lên, vừa mới nhục nhã hắn Phượng Tường, Phượng Triêu hai người đi ra."),t("br"),n._v(" “Ta còn tưởng rằng là ai tìm ta bọn họ hai huynh đệ cái, làm sao, cảm thấy vừa mới nằm cạnh đánh không đủ? Muốn tại tới thử một chút...”"),t("br"),t("br"),n._v("Cười lạnh, Phượng Triêu ngón tay hướng về phía Phượng Cửu Ca nhấn tới."),t("br"),t("br"),n._v("Từ khi cái tên này tu vi không cách nào tiến bộ về sau, liền biến thành huynh đệ bọn họ hai người nơi trút giận, muốn làm sao dạy dỗ liền thế nào giáo huấn."),t("br"),t("br"),n._v("Bành!"),t("br"),t("br"),n._v("Tiếng nói không có kết thúc, cả người bay ngược ra ngoài, nặng nề đâm vào trên cửa chính, sắc mặt trắng nhợt, từng ngụm từng ngụm hộc máu."),t("br"),t("br"),n._v("“Là cảm thấy đánh không đủ, chẳng qua... Không phải là các ngươi đánh ta, mà là... Ta đánh các ngươi!”"),t("br"),t("br"),n._v("Hừ lạnh một tiếng, Phượng Cửu Ca tiến về phía trước một bước, nghiêng mình đi vào một vị khác thanh niên Phượng Tường trước mặt."),t("br"),t("br"),n._v("“Ngươi...”"),t("br"),t("br"),n._v("Không nghĩ tới trước đó một mực khi dễ phế vật, một chân liền đem huynh đệ của mình đá bay, liền một chút năng lực phản kháng đều không có, Phượng Tường sợ hết hồn, vội vàng lui về phía sau."),t("br"),t("br"),n._v("Bất quá, hắn lui được nhanh, đối phương tới càng nhanh, ngay sau đó nhìn thấy một cái bàn tay đánh tới."),t("br"),t("br"),n._v("Đùng!"),t("br"),t("br"),n._v("Vang dội bạt tai bên dưới, vị này mới vừa rồi còn ngông cuồng tự đại hạch tâm đệ tử, lập tức nằm ngang trên mặt đất, thân thể không ngừng run rẩy, răng mất trên đất."),t("br"),t("br"),n._v("“Phượng Cửu Ca, thực lực của ngươi khôi phục? Điều đó không có khả năng... Ngươi muốn làm gì?”"),t("br"),t("br"),n._v("Thấy hắn hai chiêu đánh bại hai vị hạch tâm đệ tử, tỉnh táo lại, đồng loạt lui về phía sau, từng cái tràn đầy khó tin."),t("br"),t("br"),n._v("Hai năm trước, trước mắt vị này là trong tộc người người sùng bái thần tượng, vốn cho rằng, tinh thần sa sút đến trước đó bộ dạng, lại không cách nào khôi phục, nằm mơ đều không có nghĩ đến, ngắn ngủi chừng nửa canh giờ, không chỉ có khí chất thay đổi, thực lực cũng so trước kia càng thêm cường đại!"),t("br"),t("br"),n._v("“Không làm gì... Chỉ là tìm về ta mất đi tôn nghiêm mà thôi!”"),t("br"),t("br"),n._v("Tiến về phía trước một bước, Phượng Cửu Ca ánh mắt như điện."),t("br"),t("br"),n._v("Trong tộc số một số hai thiên tài, lúc ấy vô số người vây đỡ, rơi xuống Thần Đàn về sau, gặp ức hiếp càng lớn, lúc này lần nữa khôi phục, tự nhiên muốn để trước đó bắt nạt hắn người nhìn một chút..."),t("br"),t("br"),n._v("Vị kia thiên tư trác tuyệt, để vô số người ngước nhìn Phượng Cửu Ca... Lần nữa trở về!"),t("br"),t("br"),n._v("“Ngươi... Trong cơ thể đã không còn gia tộc huyết mạch, bị trục xuất gia tộc, dám đối với chúng ta động thủ, chẳng lẽ không sợ nhận Hỏa Phượng nhất tộc trách phạt?”"),t("br"),t("br"),n._v("Thấy hắn khí tức càng ngày càng mạnh, Phượng Tường sợ tới mức liên tiếp lui về phía sau, cắn răng nói."),t("br"),t("br"),n._v("Đối phương tu vi khôi phục thì đã có sao?"),t("br"),t("br"),n._v("Vừa đã kiểm tra huyết mạch, huyết mạch chi lực đã biến mất, coi như lần nữa trở về, cũng không cách nào đi vào gia tộc, chớ nói chi là quay về hạch tâm đệ tử thân phận."),t("br"),t("br"),n._v("Không có loại thân phận này, mạnh hơn cũng chỉ là cái tán tu, tài nguyên có hạn, về sau thành tựu cũng liền có hạn."),t("br"),t("br"),n._v("Thần Vương sẽ là lớn nhất khảm, gần như không có khả năng vượt quá."),t("br"),t("br"),n._v("“Cái này...”"),t("br"),t("br"),n._v("Phượng Cửu Ca ngừng lại."),t("br"),t("br"),n._v("Đối phương nói không sai, tuy là không biết huyết mạch tại sao lại biến mất, có thể trước đó đo lường, là thực sự biến mất."),t("br"),t("br"),n._v("Nhịn không được ngẩng đầu nhìn về phía cách đó không xa lão sư, chỉ thấy hắn khẽ mỉm cười: “Thực lực đều khôi phục, có lẽ huyết mạch cũng có thể khôi phục, đi vào tại đo lường một lần là được!”"),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-2202"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-2204"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);